te the Policy to ensure that it is consistent with any changes in legal or regulatory requirements. When you submit information to us, or sign up as a customer on our website, or view any of the products or services offered by us, you agree and consent to the collection, use, and processing of the personal information, in the manner set forth in this Privacy Policy. Subject to your rights at law, you agree to be bound by the prevailing terms of the Personal Data Protection Policy as updated from time to time on our website.</p>\r\n            <div class=\"termWrap\">\r\n                <h3>Personal Data Policy</h3>\r\n                <p>The Personal Data Policy refers to any information whether recorded in a material form or not, from which the identity of a member gets apparent or can be reasonably and directly ascertained by the entity holding the information, or when put together with other information would directly and certainly identify a member.</p>\r\n                <p>When one creates a Winztime account, any personal information we collect may include your: Name, Email, Gender, Birthday, Mobile Number, and Delivery/Billing Address. When a member places an order, Winztime may collect information relevant to your preferred payment method. Winztime may collect, use, and disclose your Personal Data to certain third-parties identified below, for the following purposes:\r\n                </p>\r\n                <ul>\r\n                    <li>Fulfillment and delivery of products which members have purchased from Winztime and updating them on the status thereof;</li>\r\n                    <li>Processing a member’s orders, including processing thereof for payment;</li>\r\n                    <li>Providing members with relevant product information, responding to their queries and requests, and other customer support functions;</li>\r\n                    <li>Preventing, detecting, and investigating disputes or fraud, and analyzing and managing commercial risks;</li>\r\n                    <li>Analytics and tracking;</li>\r\n                    <li>Conducting market research and surveys to enable us to understand and determine customer preferences and demographics, to develop special offers, and marketing programs in relation to Winztime products and services, and to improve customer experience;</li>\r\n                    <li>Developing and providing members with additional products, services, and benefits, including promotions, loyalty and rewards programs;</li>\r\n                    <li>Purposes which are reasonably related to the aforesaid; and other legal purposes.</li>\r\n                </ul>\r\n            </div>\r\n            <div class=\"termWrap\">\r\n                <h3>Disclosure Of Personal Information</h3>\r\n                <p>We may disclose member’s personal information if we are required by law to do so or if you violate our Terms of Service.</p>\r\n            </div>\r\n            <div class=\"termWrap\">\r\n                <h3>Methods Utilized for Automated Access</h3>\r\n                <p>When members visit Winztime our company servers will automatically record information that their browser sends whenever they visit a website. This data may include:</p>\r\n                <ul>\r\n                    <li>Computer’s IP address</li>\r\n                    <li>Browser type</li>\r\n                    <li>Webpage they were visiting before coming to our site</li>\r\n                    <li>The pages within “Your company name” they visit</li>\r\n                    <li>The time spent on those pages, items and information searched for on our site, access times and dates, and other statistics.</li>\r\n                </ul>\r\n                <p>This information is collected for analysis and evaluation in order to help us improve our site and the services and products we provide. This data will not be used in association with any other Personal Data.</p>\r\n            </div>\r\n            <div class=\"termWrap\">\r\n                <h3>Data Protection</h3>\r\n                <p>To protect members personal information, we take reasonable precautions and follow industry best practices to make sure it is not inappropriately lost, misused, accessed, disclosed, altered or destroyed.</p>\r\n                <p>If you provide us with your credit card information, the information is encrypted using secure socket layer technology (SSL). Although no method of transmission over the Internet or electronic storage is 100% secure, we follow all PCI-DSS requirements and implement additional generally accepted industry standards.</p>\r\n            </div>\r\n            <div class=\"termWrap\">\r\n                <h3>Your Rights</h3>\r\n                <p>If a member intends to exercise their rights to make inquiries, access, update, erase, destroy copies of, or correct their Personal Data, withdraw consent to the collection, use or disclosure of their Personal Data, to obtain and electronically move, copy or transfer their data, or if a member believes that their privacy has been breached. In any manner, they may contact Winztime Company through the Contact Information provided below.</p>\r\n                <ul>\r\n                    <li>To withdraw consent from promotional emails: please click on the Unsubscribe link in the promotional emails.</li>\r\n                    <li>To withdraw consent from receiving promotional material with your order package: please email customer service, with the words \"PERSONAL DATA\" in the subject line, at the address provided below.</li>\r\n                </ul>\r\n                <p>Please be aware that once we receive confirmation that a member wishes to withdraw their consent for marketing or promotional materials/communication, it may take up to thirty (30) days for their withdrawal to be taken in our systems. Therefore, they may still receive marketing or promotional materials/communication during this time period. Please note that even if a member withdraws their consent for the receipt of marketing or promotional materials through a specific mode, Winztime may still contact members for other purposes in relation to the products and services that a member holds or have subscribed to with Winztime.</p>\r\n            </div>\r\n            <div class=\"termWrap\">\r\n                <h3>Contacting Us</h3>\r\n                <p>For any questions related to our Personal Data or about Winztime Privacy Policy, members may write to us at <a href=\"mailto:info@winztime.com\">info@winztime.com</a></p>\r\n            </div>\r\n        </div>\r\n        <div class=\"userAgreWrap\" id=\"userAgremMain\">\r\n            <h2>Winztime User Agreement</h2>\r\n            <p>Below given is the Preamble and General Terms, along with the Privacy Policy, Draw Terms User Agreement constitute the contract between You and Winztime.</p>\r\n            <div class=\"termWrap\">\r\n                <h3>1. Preamble</h3>\r\n                <ul>\r\n                    <li>1.1. Any party using the website and/or participating in a Campaign Draw agrees to be bound by this User Agreement. If one does not agree to the User Agreement, or any of its terms (including any amendments), then they should immediately cease using the website and not enter any Campaign Draw.</li>\r\n                    <li>1.2. This User Agreement is in effect as of 25 May 2021. We may amend it at any point in time without notice. The amendments will take effect once they have been displayed on the website. One must acknowledge and agree that it is their responsibility to review the User Agreement periodically to familiarize themselves with any modifications. A person’s continued use of the platform or any of our products, offerings and services, including Campaign Draws following any amendments shall be construed as acceptance of those amendments.</li>\r\n                </ul>\r\n            </div>\r\n            <div class=\"termWrap\">\r\n                <h3>2. General Terms and Conditions:</h3>\r\n                <h4>2.1. Eligibility For Membership:</h4>\r\n                <ul>\r\n                    <li>2.1.1. It is imperative for Winztime to ensure that our members get to enter into legally binding contracts and that minors do not purchase, use, or have access to unsuitable content. Membership and/or use of the website is not available to people under the age of 18 years. By using the website, one agrees that they are 18 years of age or over. Also, that all information they submit is accurate and truthful when registering any information with the website.</li>\r\n                    <li>2.1.2. Winztime reserves the right and at its sole discretion to refuse, limit, suspend or withdraw access to the website or the membership of any person if Winztime believes that person is under the age of 18 years or that any information given is not accurate or truthful, or for any other reason.</li>\r\n                    <li>2.1.3. The website is not available to persons whose membership has been refused, limited, suspended or withdrawn by Winztime.</li>\r\n                    <li>2.1.4. No person may register as a member on the website more than once.</li>\r\n                </ul>\r\n                <h4>2.2. Registration And Membership Obligations:</h4>\r\n                <ul>\r\n                    <li>2.2.1. In order to access the Services and utilize the website one is required to create an account and register information with Winztime in order to create a membership. One must agree that any information provided to Winztime in pursuant thereto will be complete and accurate. You will not register under the name of, nor attempt to enter the Membership under the name of, another person. You will not adopt a username that Winztime’s sole discretion, deem offensive. Winztime reserves the right to not allow XYZ to register if we believe that a person does not comply with these Terms.</li>\r\n                    <li>2.2.2. The members are responsible to promptly update details of their membership such that they are at all times considered true, accurate, current and complete. If they provide any information that is untrue, inaccurate, not current or incomplete or if Winztime suspects in that the information is untrue, inaccurate, not current or incomplete, or not in accordance with this User Agreement, Winztime has the right to suspend indefinitely, limit or withdraw the Membership and/or access to the website.</li>\r\n                    <li>2.2.3. When registering an account on the website in order to create membership, members are required to provide certain information; register a username and password for use of the website. To keep one\'s account secure they have to protect their account with reasonable means, and are responsible at all times for maintaining the confidentiality of, and restricting access to and use of, their account and password to the website. One must agree to accept responsibility for all activities that occur under their account with Winztime. If someone other than the member uses the website with their login information, they will be held accountable for all actions made in the member’s name. In the event of termination, they will no longer be authorized to access the website or Membership. Winztime reserves the right to use any means possible to enforce this termination. The member must undertake the responsibility to immediately notify Winztime of any unauthorized use of their membership or any other security breach.</li>\r\n                    <li>2.2.4. One may not, at any point in time, use any other person’s Membership. Members must agree to reimburse Winztime in full for any costs, expenses and damages caused by improper, unauthorized or illegal use of their Membership and password by them or any person obtaining access to the website.</li>\r\n                    <li>2.2.5. Members may not transfer or sell their Membership with Winztime to another party and they must undertake that they are solely responsible for all activity of the Membership.</li>\r\n                </ul>\r\n                <h4>2.3. Payment Gateway</h4>\r\n                <ul>\r\n                    <li>2.3.1. If a member makes a payment for Winztime Services on our website, the details they are asked to submit will be provided directly to our payment provider via a secure connection.</li>\r\n                    <li>2.3.2. The cardholder must retain a copy of transaction records and merchant policies and rules.</li>\r\n                    <li>2.3.3. Multiple transactions may result in multiple postings to the cardholder’s monthly statement.</li>\r\n                    <li>2.3.4. The product prices per unit displayed on the Winztime website are inclusive of VAT.</li>\r\n                    <li>2.3.5. Users may be charged in US Dollar (United States Dollar) or any other currency depending on where they are using the website from and what type of Credit Card they are using. In such cases, there may be slight discrepancies in values due to changes in foreign exchange rates.</li>\r\n                </ul>\r\n                <h4>2.4. Refund & Cancellation Policy</h4>\r\n                <ul>\r\n                    <li>2.4.1. All sales are final with no cancellation options.</li>\r\n                    <li>2.4.2. For any defective products, Winztime will offer members a replacement of the defective product only, subject to any warranties and/or guarantees provided by the manufacturer of the product. Winztime does not have any liability or responsibility in relation to any defect regarding a prize awarded as a result of a Campaign Draw.</li>\r\n                    <li>2.4.3. No other form of refund is permissible.</li>\r\n                </ul>\r\n                <h4>2.5. Digital Media</h4>\r\n                <ul>\r\n                    <li>2.5.1. Members must consent to the use of their name in the event they are the Winner of any of the Campaign Draws. This includes but is not limited to use of their name in the local and regional press, on the website and on any social (online) media profile associated with Winztime.</li>\r\n                    <li>2.5.2. Members must consent that Winztime has the right to use any and all digital records made by Winztime including, but not limited to, photographs, videos and call recordings of, the Prize, the Campaign Draw, the winning phone call and the collection of the Prize, on the website and on any social (online) media profile associated with Us. These digital records may include imagery and/or voice recordings of the Winner and/or their name.</li>\r\n                </ul>\r\n                <h4>2.6. Disclaimer for Third Party Applications</h4>\r\n                <ul>\r\n                    <li>2.6.1. The use of any third-party application is subject to any terms and conditions provided with such third-party application and is not governed by Winztime. The use of third-party applications is solely the member’s responsibility since Winztime does not govern the use of such third-party applications. Winztime is not responsible for any third-party applications and acknowledges that such applications may be modified or removed by their original publisher and/or respective rights owner at any time. Members must assume all responsibility and risk of use of any third-party applications (including any content therein) and Winztime hereby disclaims any and all liability to You or any third party related thereto.</li>\r\n                    <li>2.6.2. Winztime does not have any obligation to examine or scan third party applications, for any purpose, and is not responsible for the accuracy, completeness, appropriateness or legality of any third-party applications. The fact that a third-party application is available via any online website or otherwise is not an endorsement, authorization or representation of Winztime’s affiliation with any third party, nor is it an endorsement of such third-