 anticipated profits, loss of goodwill, loss of business, loss of data, computer failure or malfunction, or any other damages.</li>\r\n                    <li>2.7.4. WE EXPRESSLY DISCLAIM ALL WARRANTIES AND CONDITIONS OF ANY KIND, WHETHER EXPRESS OR IMPLIED, INCLUDING, BUT NOT LIMITED TO THE IMPLIED WARRANTIES AND CONDITIONS OF MERCHANTABILITY, FITNESS FOR A PARTICULAR PURPOSE AND NON-INFRINGEMENT.</li>\r\n                    <li>2.7.5. In conjunction with the limitation of warranties as explained herein, one must humbly understand and agree that any claim against Winztime shall be limited to the amount they paid to us, if any, for use of our website and/or Services.</li>\r\n                </ul>\r\n                <h4>2.8. No Spam Policy</h4>\r\n                <ul>\r\n                    <li>2.8.1. You understand and agree that sending unsolicited email advertisements or other unsolicited communications to Winztime email addresses or through Winztime information systems are expressly prohibited by these Terms. Any unauthorized use of Winztime computer systems is a violation of our User Agreement and certain applicable laws, in particular the UAE Cybercrime legislation. Such violations may subject the sender and his or her agents to civil and criminal penalties. Please note that the UAE Cybercrime legislation carries significant penalties including imprisonment. In case members intend to solicit, or contact our other members by obtaining their email or phone numbers via our website, we may report this behavior to the relevant authorities, who then may decide to prosecute the culprit under the relevant UAE laws.</li>\r\n                </ul>\r\n                <h4>2.9. General Information</h4>\r\n                <ul>\r\n                    <li>2.9.1. The failure of Winztime to exercise or enforce any right or provision of this User Agreement shall not constitute a waiver of such right or provision.</li>\r\n                    <li>2.9.2. If any provision of this User Agreement is found by a court of competent jurisdiction to be invalid (including, without limitation, because such provision is inconsistent with the laws of another jurisdiction) or inapplicable, Winztime and the Member nevertheless agree that the court should endeavor to give effect to our intentions as reflected in this User Agreement. If any provision or provisions of this User Agreement is held to be invalid, illegal or unenforceable, the validity, legality and enforceability of the remaining provisions of this User Agreement shall not in any way be affected or be impaired.</li>\r\n                    <li>2.9.3. One must agree that any cause of action brought by them or arising out of /or related to their use of the service and/or the website must commence within a reasonable time. In any event, within one (1) year after the cause of action accrues.</li>\r\n                </ul>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</section>',NULL,NULL,NULL,1,5),(16,'Terms & Conditions','<section class=\"main-section terms-section\">\r\n    <div class=\"container\">\r\n        <h1>Winztime Terms & Conditions</h1>\r\n        <div class=\"termWrap\">\r\n            <h3>Overview</h3>\r\n            <p>This website is operated by Winztime, the terms \"we\", \"us\" and \"our\" refers to Winztime offers on our website, including all information, tools and services available from this site to you. The user, conditions upon acceptance of all terms, conditions, policies and notices are stated here.</p>\r\n            <p>By visiting our site and/ or purchasing something from us, you engage in our \"Service\" and agree to be bound by the following terms and conditions (\"Terms of Service\", \"Terms\"), including those additional terms and conditions and policies referenced herein and/or available by hyperlink. These Terms of Service apply to all users of the site, including without limitation users who are browsers, vendors, customers, merchants, and/ or contributors of content.</p>\r\n            <p>Please read these Terms of Service carefully before accessing or using our website. By accessing or using any part of the site, you agree to be bound by these Terms of Service. If you do not agree to all the terms and conditions of this agreement, then you may not access the website or use any other services. If these Terms of Service are considered an offer, acceptance is expressly limited to these Terms of Service.</p>\r\n        </div>\r\n        <div class=\"termWrap\">\r\n            <h3>General Conditions</h3>\r\n            <p>We reserve the right to refuse service to anyone for any reason at any time.\r\n            You understand that your content (not including credit card information), may be transferred unencrypted and involve (a) transmissions over various networks; and (b) changes to conform and adapt to technical requirements of connecting networks or devices. Credit card information is always encrypted during transfer over networks.</p>\r\n            <p>You agree not to reproduce, duplicate, copy, sell, resell or exploit any portion of the Service, use of the Service, or access to the Service or any contact on the website through which the service is provided, without written permission by us.</p>\r\n            <p>The headings used in this agreement are included for convenience only and will not limit or otherwise affect these Terms.</p>\r\n        </div>\r\n        <div class=\"termWrap\">\r\n            <h3>Modifications Of the Service and Prices</h3>\r\n            <p>Prices for our products are subject to change without notice.</p>\r\n            <p>We reserve the right at any time to modify or discontinue the Service (or any part or content thereof) without notice at any time.</p>\r\n            <p>We shall not be liable to you or to any third-party for any modification, price change, suspension or discontinuance of the Service.</p>\r\n        </div>\r\n        <div class=\"termWrap\">\r\n            <h3>Products Or Services (If Applicable)</h3>\r\n            <p>Certain products or services may be available exclusively online through the website. These products or services may have limited quantities and are subject to return or exchange only according to our Return Policy.</p>\r\n            <p>We have made every effort to display as accurately as possible the colors and images of our products that appear at the store. We cannot guarantee that your computer monitor\'s display of any color will be accurate.</p>\r\n            <p>We reserve the right, but are not obligated, to limit the sales of our products or Services to any person, geographic region or jurisdiction. We may exercise this right on a case-by-case basis. We reserve the right to limit the quantities of any products or services that we offer. All descriptions of products or product pricing are subject to change at any time without notice, at the sole discretion of us. We reserve the right to discontinue any product at any time.</p>\r\n            <p>Any offer for any product or service made on this site is void where prohibited. We do not warrant that the quality of any products, services, information, or other material purchased or obtained by you will meet your expectations, or that any errors in the Service will be corrected.</p>\r\n        </div>\r\n        <div class=\"termWrap\">\r\n            <h3>Accuracy Of Billing and Account Information</h3>\r\n            <p>We reserve the right to refuse any order you place with us. We may, in our sole discretion, limit or cancel quantities purchased per person, per household or per order. These restrictions may include orders placed by or under the same customer account, the same credit card, and/or orders that use the same billing and/or shipping address. </p>\r\n            <p>In the event that we make a change to or cancel an order, we may attempt to notify you by contacting the e-mail and/or billing address/phone number provided at the time the order was made. We reserve the right to limit or prohibit orders that, in our sole judgment, appear to be placed by dealers, resellers or distributors.</p>\r\n            <p>You agree to provide current, complete and accurate purchase and account information for all purchases made at our store. You agree to promptly update your account and other information, including your email address and credit card numbers and expiration dates, so that we can complete your transactions and contact you as needed.</p>\r\n            <p>For more detail, please review our Returns Policy.</p>\r\n        </div>\r\n        <div class=\"termWrap\">\r\n            <h3>Personal Information</h3>\r\n            <p>Your submission of personal information through the store is governed by our Privacy Policy.</p>\r\n        </div>\r\n        <div class=\"termWrap\">\r\n            <h3>Termination</h3>\r\n            <p>The obligations and liabilities of the parties incurred prior to the termination date shall survive the termination of this agreement for all purposes.</p>\r\n            <p>These Terms of Service are effective unless and until terminated by either you or us. You may terminate these Terms of Service at any time by notifying us that you no longer wish to use our Services, or when you cease using our site.</p>\r\n            <p>If in our sole judgment you fail, or we suspect that you have failed, to comply with any term or provision of these Terms of Service, we also may terminate this agreement at any time without notice and you will remain liable for all amounts due up to and including the date of termination; and/or accordingly may deny you access to our Services (or any part thereof).</p>\r\n        </div>\r\n        <div class=\"termWrap\">\r\n            <h3>Entire Agreement</h3>\r\n            <p>The failure of us to exercise or enforce any right or provision of these Terms of Service shall not constitute a waiver of such right or provision.</p>\r\n            <p>These Terms of Service and any policies or operating rules posted by us on this site or in respect to The Service constitutes the entire agreement and understanding between you and us and govern your use of the Service, superseding any prior or contemporaneous agreements, communications and proposals, whether oral or written, between you and us (including, but not limited to, any prior versions of the Terms of Service).</p>\r\n            <p>Any ambiguities in the interpretation of these Terms of Service shall not be construed against the drafting party.</p>\r\n        </div>\r\n        <div class=\"termWrap\">\r\n            <h3>Governing Law</h3>\r\n            <p>These Terms of Service and any separate agreements whereby we provide you Services shall be governed by and construed in accordance with the laws of the United Arab Emirates.</p>\r\n        </div>\r\n        <div class=\"termWrap\">\r\n            <h3>Changes To Terms of Services</h3>\r\n            <p>You can review the most current version of the Terms of Service at any time at this page. We reserve the right, at our sole discretion, to update, change or replace any part of these Terms of Service by posting updates and changes to our website. It is your responsibility to check our website periodically for changes. Your continued use of or access to our website or the Service following the posting of any changes to these Terms of Service constitutes acceptance of those changes.</p>\r\n        </div>\r\n        <div class=\"termWrap\">\r\n            <h3>Contact Information</h3>\r\n            <p>Questions about the Terms of Service should be sent to us at <a href=\"mailto:info@winztime.com\">info@winztime.com</a></p>\r\n        </div>\r\n    </div>\r\n</section>',NULL,NULL,NULL,1,6),(19,'Refund Policy','<p>Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry&#39;s standard dummy</p>\r\n\r\n<p>text ever since the 1500s, when an unknown printer took a galley of type and 