ok. It has survived not only five centuries, but also the leap into electronic typesetting,</p>\r\n\r\n<p>remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing</p>\r\n\r\n<p>Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions</p>\r\n\r\n<p>of Lorem Ipsum. Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been</p>\r\n\r\n<p>the industry&#39;s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled</p>\r\n\r\n<p>it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting,</p>\r\n\r\n<p>remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing</p>\r\n\r\n<p>Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions</p>\r\n\r\n<p>of Lorem Ipsum.</p>',NULL,NULL,NULL,1,7),(22,'About Us','<div class=\"container\">\n  <div class=\"row\">\n    <h1>About Us</h1>\n    <p><b>\"The home of a perfect win.\"</b> This notion was, is, and will remain the reason why we exist. To make everyone feel like a winner, we came up with Winztime UAE.</p> \n    <p>We are a sports and gym accessories E-commerce store with a twist. The twist is to kick off with an incredible giveaway, astonishing surprises, and exclusive deals that are available 24/7. The best part of these giveaways and deals is to benefit the consumer and people who are less fortunate globally.</p> \n    <p>Shop with Winztime, donate our products to charity or refer a friend and increase your chances of winning with us. With us, you get the band for your choice! Don\'t wait anymore. Winning is easy with Winztime, please register today.</p>\n    <div class=\"about-video\">\n<iframe width=\"100%\" height=\"645px\" src=\"https://www.youtube.com/embed/0oKHxrKP6po\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\"></iframe>\n    </div>\n  </div>\n</div>','Winztime UAE | The Home of Perfect Win',NULL,'Shop with Winztime UAE, donate our products to charity or refer a friend and increase your chances of winning. Get the prize of your choice with us! ',1,8),(35,'Community Support','<div class=\"row\">\r\n<div class=\"col-md-6\">\r\n<p>For the most amazing people on Earth,</p>\r\n<br>\r\n<br>\r\n<p>It is only through caring people like you that we can keep our promise support the people who need us the most, whenever and wherever the need us. Your contribution will help to sustain and enlarge the safety net for families and make a real difference in their quality of life. In that spirit, Lucramania has designed a win-for-all experience to further its mission.</p>\r\n<br>\r\n<br>\r\n<p>Your generous contribution allows you to give-away the purchased product, or a percentage of its sale, and in return you will receive an additional free ticket that will increase your chances of winning a highly sought-after prize! Lucramania will ensure that your support arrives in time to make a difference.</p>\r\n<br>\r\n<br>\r\n<p>Thank you, for your support, and for being there for people in-need!</p>\r\n<br>\r\n<br>\r\n<p>Lucramania’s Team</p>\r\n</div>\r\n<div class=\"col-md-6\">\r\n<figure><img src=\"web/assets/images/sec1Logo.png\" /></figure>\r\n</div>\r\n</div>',NULL,NULL,NULL,1,11),(37,'Frequently Asked Questions','<section class=\"main-section faq-section\">\r\n    <div class=\"container\">\r\n        <h1>Frequently Asked Questions</h1>\r\n        <hr>\r\n        <div class=\"accordions\">\r\n\r\n            <div class=\"row\">\r\n                <div class=\"col-md-6\">\r\n                    <h3>About Us:</h3>\r\n                    <button class=\"accordion\">What Is Winztime?</button>\r\n                    <div class=\"panel\">\r\n                      <p>Winztime is a sports and gym accessories ecommerce store with a twist. Our customers receive a complimentary Prize Draw ticket with every purchase made, that could win you a luxury prize.</p>\r\n                  </div>\r\n                  <button class=\"accordion\">How can I access Winztime.com?</button>\r\n                  <div class=\"panel\">\r\n                      <p>Winztime is available on desktop, smartphone, tablet, and via our website. The site has a very good filter system that allows customers to view products based on Brands, subcategories, and other attributes.</p>\r\n                  </div>\r\n                  <button class=\"accordion\">How To Find Us?</button>\r\n                  <div class=\"panel\">\r\n                      <p>Winztime HQ is based in UAE, Dubai and does service to customers in UAE, GCC countries and globally. Outlet stores are coming soon to the region. Meanwhile, please go to our \'Contact Us page if you have any inquiries.</p>\r\n                  </div>\r\n                  <button class=\"accordion\">I\'m new to Winztime. How does it work?</button>\r\n                  <div class=\"panel\">\r\n                      <p>Our website has a full tutorial. You can use it easily at any time by clicking the link.</p>\r\n                  </div>\r\n                  <button class=\"accordion\">What countries Does Winztime Operate in?</button>\r\n                  <div class=\"panel\">\r\n                      <p>Winztime can be accessed globally. Please see our ‘Draw Terms &amp; Conditions’ for all the details on product/prize collection for international users. Please get in touch with us for details.</p>\r\n                  </div>\r\n                  <button class=\"accordion\">Why buy from Winztime.com?</button>\r\n                  <div class=\"panel\">\r\n                      <p>We provide elite fitness products at a faster pace to market that are not easily available at affordable prices. Our dedicated team with passion for fitness knows what we are selling and what our eager customers are looking for.</p>\r\n                  </div>\r\n                  <h3>Z points:</h3>\r\n                  <button class=\"accordion\">What are Z points?</button>\r\n                  <div class=\"panel\">\r\n                      <p>Our loyal members receive 1 Z point on every 10 AED spent. These points can be collected and then used to make purchases.</p>\r\n                  </div>\r\n                  <button class=\"accordion\">Can I transfer my Z points?</button>\r\n                  <div class=\"panel\">\r\n                      <p>Currently Z points cannot be transferred.</p>\r\n                  </div>\r\n                  <button class=\"accordion\">Can a member purchase Z points?</button>\r\n                  <div class=\"panel\">\r\n                      <p>Our members cannot purchase Z points at the moment.</p>\r\n                  </div>\r\n                  <button class=\"accordion\">How can a member earn more Z points?</button>\r\n                  <div class=\"panel\">\r\n                      <p>One can earn more Z points earned on every purchase by improving their tier status.</p>\r\n                  </div>\r\n                  <button class=\"accordion\">Can we combine Z points with cash to make purchases?</button>\r\n                  <div class=\"panel\">\r\n                      <p>Z points can be combined with cash to complete a purchase. This option is only available when members have insufficient points to make a purchase.</p>\r\n                  </div>\r\n                  <button class=\"accordion\">What is the minimum amount of points a member can withdraw/use?</button>\r\n                  <div class=\"panel\">\r\n                      <p>If a member has 125 points then they can use only 100 points otherwise they can wait and use 200 points in one go.</p>\r\n                  </div>\r\n                  <h3>Account:</h3>\r\n                  <button class=\"accordion\">Why should I register an account with Winztime?</button>\r\n                  <div class=\"panel\">\r\n                      <p>To complete a purchase with Winztime, you must have a registered account. The account is for our customer\'s security and privacy.</p>\r\n                  </div>\r\n                  <button class=\"accordion\">How do I edit my Winztime account?</button>\r\n                  <div class=\"panel\">\r\n                      <p>Click on your photo or name icon located in the main menu to edit your account. Tap the profile section to edit and click “Save Changes” to complete.</p>\r\n                  </div>\r\n                  <button class=\"accordion\">How do I \'Logout\' of my Winztime account?</button>\r\n                  <div class=\"panel\">\r\n                      <p>To \'Logout,\' click on your name/photo in the top right-hand corner and select \'Logout\' from the drop-down menu.</p>\r\n                  </div>\r\n                  <button class=\"accordion\">I can\'t remember my Winztime account password!</button>\r\n                  <div class=\"panel\">\r\n                      <p>At \'Login,\' select \'Forgot Password\' and follow the instructions on the screen for a password reset.</p>\r\n                  </div>\r\n                  <button class=\"accordion\">Is there post purchase support?</button>\r\n                  <div class=\"panel\">\r\n                      <p>Yes, if you need help in understanding how to use the product. Please get in touch and we will advise you.</p>\r\n                  </div>\r\n                  <button class=\"accordion\">What Credit Cards does Winztime accept?</button>\r\n                  <div class=\"panel\">\r\n                      <p>We accept all major cards, including MasterCard, Visa, and Amex.</p>\r\n                  </div>\r\n                  <button class=\"accordion\">Why am I receiving \'push notifications’/emails from Winztime?</button>\r\n                  <div class=\"panel\">\r\n                      <p>Winztime does not like spamming or bombarding its users with irrelevant push notifications/emails. Any notices sent by us have been deemed relevant to your user experience.</p>\r\n                  </div>\r\n                  <button class=\"accordion\">How do I set up my Winztime account?</button>\r\n                  <div class=\"panel\">\r\n                      <p>To create an account, click ‘Login/Register’ in the top right-hand corner of your screen and enter your details in the fields highlighted.</p>\r\n                  </div>\r\n                  <button class=\"accordion\">In my Winztime account, to complete a purchase, can I use someone else\'s credit card?</button>\r\n                  <div class=\"panel\">\r\n                      <p>Based on your consent, you can use/save any credit card to complete your purchase.</p>\r\n                  </div>\r\n                  <button class=\"accordion\">Will I receive \'push notifications\' if I \'Log Out\'?</button>\r\n                  <div class=\"panel\">\r\n                      <p>You will receive general notifications when logged out. To receive account-related information, you must \'Login.\'</p>\r\n                  </div>\r\n                  <button class=\"accordion\">My account\'s password needs to get changed.</button>\r\n                  <div class=\"panel\">\r\n                      <p>To change your password, click on your photo/name in the top right-hand corner and select \'My Account. From this tab, select the \'Account\' tab to change your password.</p>\r\n                  </div>\r\n                  <button class=\"accordion\">How do I close my Winztime account?</button>\r\n                  <div class=\"panel\">\r\n                      <p>To close your account, you need to notify us in writing (from your registered email account) at: <a href=\"mailto:info@winztime.com\">info@winztime.com</a>.</p>\r\n                      <p>Hereafter, a member of our support team will assist you within 48 hours.</p>\r\n                  </div>\r\n              </div>\r\n              <div class=\"col-md-6\">\r\n                <h3>Questions Regarding Purchases:</h3>\r\n                <button class=\"accordion\">Are there any unseen charges I should know of?</button>\r\n                <div class=\"panel\">\r\n                  <p>There are no hidden charges on any Winztime purchase. However, we recommend checking with your bank to see if they apply any transaction/processing fees.</p>\r\n              </div>\r\n              <button class=\"accordion\">Will I be charged VAT?</button>\r\n              <div class=\"panel\">\r\n                  <p>Yes! From January 1st, 2018, all purchases will incur 5% VAT.</p>\r\n              </div>\r\n              <button class=\"accordion\">What currencies can I use to purchase a Winztime product?</button>\r\n              <div class=\"panel\">\r\n                  <p>Winztime currently only accepts Dirhams and US Dollars. You can purchase Winztime products via any bank account with any currency. However, Winztime won\'t take responsibility for final billings affected by exchange rates or fees imposed by your branch.</p>\r\n              </div>\r\n              <button class=\"accordion\">Can I pay in installments?</button>\r\n              <div class=\"panel\">\r\n                  <p>We will be adding this attribute very soon. Please stay tuned for further updates.</p>\r\n              </div>\r\n              <button class=\"accordion\">Can I cancel/refund a Winztime purchase order?</button>\r\n              <div class=\"panel\">\r\n                  <p>As per the \'User Agreement,\' all sales purchases are final, and no refunds are given under any circumstances.</p>\r\n              </div>\r\n              <h3>Winztime Products:</h3>\r\n              <button class=\"accordion\">Where can I collect my Winztime products?</button>\r\n              <div class=\"panel\">\r\n                  <p>All Winztime products can be collected by you directly from Winztime HQ. Please read the \'User Agreement\' before making/managing your purchase.</p>\r\n              </div>\r\n              <button class=\"accordion\">Can I send somebody else to collect my Winztime products?</button>\r\n              <div class=\"panel\">\r\n                  <p>Only the registered holder of the account, or (and at our discretion), an individual with \'Power of Attorney (POA) can collect the registered account holders\' purchase from Winztime. Passport or Emirates ID are the only acceptable forms of identification (please ensure your title is up to date).</p>\r\n              </div>\r\n              <h3>Refer a Friend:</h3>\r\n              <button class=\"accordion\">What is the refer a friend program?</button>\r\n              <div class=\"panel\">\r\n                <p>The refer a friend program is made to reward. Every time you refer a friend to Winztime using the invitation code generated, you will be rewarded with a complimentary Draw Voucher once they make their first transaction.</p>\r\n            </div>\r\n            <button class=\"accordion\">A friend referred me. Will the referral program reward me?</button>\r\n              <div class=\"panel\">\r\n                <p>Winztime Yes, once you have successfully registered with Winztime, one Draw Voucher will be added to your account.</p>\r\n            </div>\r\n            <h3>Prizes:</h3>\r\n              <button class=\"accordion\">Where can I collect my Winztime Prize?</button>\r\n              <div class=\"panel\">\r\n                <p>Details regarding prize collection will be sent to the Winner through email. For more information, please refer to the \'Draw Terms &amp; Conditions.</p>\r\n            </div>\r\n            <button class=\"accordion\">What if I do not want people to know I have won the Winztime prize draw?</button>\r\n              <div class=\"panel\">\r\n                <p>As per the \'Draw Terms &amp; Conditions\', Winztime has the right to use your image, name, or any statements made across all our marketing channels.</p>\r\n            </div>\r\n            <button class=\"accordion\">How do we get notified about the status of the Campaign: \'Coming Soon\'/\'Launched\'/\'Ending\'/\'Closed\'.?</button>\r\n              <div class=\"panel\">\r\n                <p>Winztime sends \'Push Notifications’/emails to notify all ticket holders regarding the status of each Campaign.</p>\r\n            </div>\r\n            <button class=\"accordion\">Can I send somebody else to collect my Prize?</button>\r\n              <div class=\"panel\">\r\n                <p>Only the registered account holder or any individual with \'Power of Attorney\' can collect the registered account holders\' Winztime Prize. Emirate’s passports or ID are the only acceptable forms of identification. Please ensure your title is up to date.</p>\r\n            </div>\r\n            <button class=\"accordion\">Can I view past winners of the Winztime Campaign draws?</button>\r\n              <div class=\"panel\">\r\n                <p>You can view past winners of Winztime campaigns via our social media channels, as well as our up-and-coming \'News\' segment.</p>\r\n            </div>\r\n            <h3>Security FAQ:</h3>\r\n            <button class=\"accordion\">Are my details secure with Winztime?</button>\r\n              <div class=\"panel\">\r\n                <p>Winztime does not store or save any sensitive and Credit Card information on its servers. Credit Card details registered with us are stored securely through the \'Checkout\' secure online payment gateway. For further information, please reach us out.</p>\r\n            </div>\r\n            <button class=\"accordion\">Will I be spammed by Winztime?</button>\r\n              <div class=\"panel\">\r\n                <p>No! We do not enjoy spamming our valuable customers. </p>\r\n            </div>\r\n             <h3>Other Inquiries:</h3>\r\n            <button class=\"accordion\">Careers</button>\r\n              <div class=\"panel\">\r\n                <p>Click \'Help Centre\' in the Main Menu of the Website and select \'Inquiries\' from the list for job vacancy related inquiries. We keep updating our website to keep you informed about any updates. </p>\r\n            </div>\r\n            <button class=\"accordion\">Need to ask us something?</button>\r\n              <div class=\"panel\">\r\n                <p>If you have any inquiries regarding any characteristic of your Winztime experience, please head onto the Main Menu and select \'Help Centre\' from the list. From there, you can choose to contact us via phone/email with any questions you may have.</p>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>\r\n</div>\r\n</section>',NULL,NULL,NULL,1,12),(23,'cccd','<p>ccddcdc</p>',NULL,NULL,NULL,1,9),(39,'Terms & Conditions','<section class=\"main-section\">\r\n    <div class=\"container\">\r\n<section class=\"terms-section\">\r\n\r\n\r\n\r\n    <p class=\"wow fadeIn\">These campaign draw terms and conditions (“Draw Terms”) govern the terms and conditions applicable to Lucramania Fitness Equipments (“Lucramania”, “We”, “Us”, “Our”) campaign draws (“Campaign Draws”) that relate to Our website (“Site”) and Our mobile app (“App”) (together the “Platform”).</p>\r\n\r\n    <p class=\"wow fadeIn\">Any party using the Platform and/or participating in a Campaign Draw (“User”, “You”, “Your”) agrees to be bound by these Draw Terms, as well as the user agreement published on the Site (“User Agreement”). If You do not agree to these Draw Terms, or any of its terms (including any amendments), then You should immediately cease using the Platform, and not enter any Campaign Draw.</p>\r\n\r\n    <p class=\"wow fadeIn\">These Draw Terms are effective as of 01 December 2020. We may amend these Draw Terms at any point in time without notice and the amendments will take effect once they have been displayed on the Platform. You acknowledge and agree that it is Your responsibility to review these Draw Terms periodically to familiarize Yourself with any modifications. Your continued use of the Platform and/or entry into Campaign Draws following any amendments shall be construed as acceptance of those amendments.</p>\r\n\r\n    <div class=\"termWrap\">\r\n\r\n        <ul>\r\n\r\n            <li class=\"wow fadeIn\">1.   Cam\r\n            paign Draws will be approved by Dubai Economy Department (“DED”) and are in accordance with the Commercial Permit Guidebook (as such may be amended from time to time). A valid permit number will be issued for each respective campaign. Where Campaigns are being run from any other jurisdiction We operate from, Lucramania will obtain the necessary regulatory requirements and permits as stipulated by the law in such jurisdiction.</li>\r\n\r\n            <li class=\"wow fadeIn\">2.   Only Users with a valid membership to the Platform (“PlatformMembers”) that satisfies all the terms of the User Agreement are eligible to enter into our Campaign Draws.</li>\r\n\r\n            <li class=\"wow fadeIn\">3.   Each product purchased from a campaign by a Platform Member is awarded a single complimentary ticket per product to a specified Campaign Draw.</li>\r\n\r\n            <li class=\"wow fadeIn\">4.   A Platform Member will have the option to either receive the purchased product or have such contributed to a charity of Our choice. If a Platform Member opts tocontribute their purchased product to charity, Lucramania will double their ticket entry into the specified Campaign Draws.</li>\r\n\r\n            <li class=\"wow fadeIn\">5.   Complimentary ticket numbers are computer generated and sequential to the order in which the products they are associated with are purchased. Platform Members cannot choose ticket numbers as they are generated only upon checkout and completion of purchase of the associated products.</li>\r\n\r\n            <li class=\"wow fadeIn\">6.   Product and the Complimentary tickets awarded to Platform Members are neither refundable nor transferable and are owned solely and exclusively by the Platform Member who they have been awarded to.</li>\r\n\r\n            <li class=\"wow fadeIn\">7.   Campaign Raffle Draws will occur within seven (7) business days after the completion of any campaign. Campaign Draws shall occur in the presence of a regulatory representative, unless the regulator approves otherwise, and as such are not subject to negotiation, interference, challenge, or argument by a Platform Member. The draw date will be subject to the representative’s availability.</li>\r\n\r\n            <li class=\"wow fadeIn\">8.   Lucramania has the right to close a Campaign Draw at any time. In the event that a campaign is oversubscribed for any reason, we will forthwith reimburse to the oversubscribed Platform Members the payment they have made for the associated produced based on the sequential ticket numbers representing the oversubscribed number of tickets.</li>\r\n\r\n            <li class=\"wow fadeIn\">9.   Winners of Campaign Draws (“Winners”) are selected by the regulatory representative and will be notified on the day the draw occurs. The names of Winners may also be announced in the local and regional press as well as on the Platform and our associated social (online) media profiles, unless You specifically advise us otherwise in writing.</li>\r\n\r\n            <li class=\"wow fadeIn\">10.  All Platform Members consent to the use of their name in the event they are the Winner of any of the Campaign Draws. This includes but is not limited to use of their name in the local and regional press, on the Platform and on any social (online) media profile associated with Us.</li>\r\n\r\n            <li class=\"wow fadeIn\">11.  Post notifying the Winner of their win on the day of the draw, an email will be sent to the registered email on the Platform detailing the next steps and how the Winner can claim the prize (“Prize”).</li>\r\n\r\n            <li class=\"wow fadeIn\">12.  All Platform Members consent that We have the right to use any and all digital records made by Us including, but not limited to, photographs, videos and call recordings of, the Prize, the Campaign Draw, the winning phone call and the collection of the Prize, on the Platform and on any social (online) media profile associated with Us. These digital records may include imagery and/or voice recordings of the Winner and/or their name.</li>\r\n\r\n            <li class=\"wow fadeIn\">13.  In the event the Winner is based in the United Arab Emirates, then he/she needs to collect the Prize fromwithin 60 calendar days and present valid identification as may be required in Our sole discretion. Lucramania may, at its sole discretion, allow an individual who has been given Power of Attorney (POA) by the account holder to collect the Prize having presented the necessary identification, Lucramania will evaluate such instances on a case by case basis and cannot guarantee that an individual with POA will be allowed to collect the Prize on behalf of the account holder. Failure to collect the Prize within this time period WILL result in Us transferring the Prize to the regulator where-after Lucramania will have no further responsibility with respect to the Prize. Post transfer, the Winner must liaise with the regulator whereupon he/she will be subject to the regulator’s own terms and conditions.</li>\r\n\r\n            <li class=\"wow fadeIn\">14.  In the event a Winner does not reside in the United Arab Emirates, We will either courier the Prize to the Winner by air or land in the case of smaller items (for a charge), or ship the Prize to the Winner’s country of residence (nearest seaport as selected by Us in Our sole discretion, for a charge), and We will insure shipment of the Prize (for a charge) until delivery thereof at the port. Collection from the port and clearance through the port and customs shall be the responsibility, and at the cost, of the Winner. Accordingly, all local taxes, custom duties, and any other form of expense beyond shipping and delivery at the port will be paid by the Winner.</li>\r\n\r\n            <li class=\"wow fadeIn\">15.  Once a Prize is handed to/collected by the courier/handler for international delivery, risk and responsibility will transfer to the Winner and We no longer hold claim nor responsibility for any damage/injury incurred in transit, or upon delivery.</li>\r\n\r\n            <li class=\"wow fadeIn\">16.  All Prizes represented on our Platform, will be awarded as displayed. Minor changes, including but not limited to color, may occur, however, no major changes, including but not limited to, specification, brand or value, will occur.</li>\r\n\r\n            <li class=\"wow fadeIn\">17.  Lucramania is not responsible for any bank charges, including but not limited to processing fees from Your local bank.</li>\r\n\r\n            <li class=\"wow fadeIn\">18.  By entering the Campaign Draw, Winners confirm their agreement to take part in any associated publicity.</li>\r\n\r\n            <li class=\"wow fadeIn\">19.  If any Winner is subsequently found ineligible to participate in the Campaign Draw, we may at Our sole discretion forfeit or reclaim the Prize or dispose of the same in such manner and to such person as We deem fit. All such decisions will be in line with DED regulations as well as UAE law.</li>\r\n\r\n            <li class=\"wow fadeIn\">20.  Winners are responsible for any and all tax liability where applicable.</li>\r\n\r\n            <li class=\"wow fadeIn\">21.  We will not be responsible for arranging insurance, including travel insurance, medical insurance, transport expenses, meal expenses, or any expenses of a personal nature, in the collection of the Prize unless otherwise stated.</li>\r\n\r\n            <li class=\"wow fadeIn\">22.  We will not be responsible for the inability of any Winner to utilize the Prize, for any reason whatsoever, including but not limited to non-issuance of a visa.</li>\r\n\r\n            <li class=\"wow fadeIn\">23.  We will not be responsible for claims, damages, or expenses of any nature whatsoever for any loss, illness, bodily injury, including death, of or to any Winner and/or any third party during and/or in course of usage of any Prize or due to any defects in any Prize.</li>\r\n\r\n        </ul>\r\n\r\n    </div>\r\n\r\n</section> \r\n\r\n<section class=\"terms-section privacy-section\">\r\n\r\n    <h2 class=\"wow fadeIn\">Privacy Policy</h2>\r\n\r\n    <div class=\"termWrap privacyWrap\">\r\n\r\n        <h4 class=\"wow fadeIn\">1. Your Information</h4>\r\n\r\n        <ul>\r\n\r\n            <li class=\"wow fadeIn\">1.1. The type of information we collect from you is either personal to you, or is general in nature:</li>\r\n\r\n            <li class=\"wow fadeIn\">1.2. Personal Information: When you register on the Platform as a member, update your information, purchase any goods or services, take part in promotions or send emails to Us, you provide Us with information that We store and process. Such information may include your name, address, phone number, email address, purchase and transaction history, interests, and other such \'Personal Information\'.</li>\r\n\r\n            <li class=\"wow fadeIn\">1.3. General Information: We also receive more general information from you as a result of your visits to, and use of, the Platform. This general information does not identify you personally, and can include information such as your IP address, the date and time you access the Platform, length of time you spend on the Platform, your browsing history (recorded by the text and graphics files that compose that page), the Internet address of the website from which you linked directly to our Platform, and other such \'General Information\'.</li>\r\n\r\n        </ul>\r\n\r\n        <h4 class=\"wow fadeIn\">2.   Collecting and Using Information</h4>\r\n\r\n        <ul>\r\n\r\n            <li class=\"wow fadeIn\">2.1. All credit/debit cards details and personally identifiable information will NOT be stored, sold, shared, rented or leased to any third parties.</li>\r\n\r\n            <li class=\"wow fadeIn\">2.2. Most of the Platform can be used without giving Us any information. However, certain services may involve collection of information from you. We use this information to provide you with a better service, and in particular to: keep internal records; improve our products, services and the Platform; communicate with you if you have ordered, purchased or participated in anything on the Platform; contact you for market research purposes; and provide you with information about new opportunities, promotions, special offers and other information that We may feel is relevant to you. If you contact Us via the Platform, or via email to the contacts set out on the Platform, we may keep a record of that correspondence.</li>\r\n\r\n            <li class=\"wow fadeIn\">2.3. We use General Information to help Us make the Platform more useful to visitors (including to help Us assess content of interest to visitors), and for other purposes such as determining the Platform’s technical design specifications and identifying system performance or problem areas, for tracking activity on the Platform, preparing reports, assessing trends, and otherwise monitoring the way in which the Platform is being used none of which would be in a way that personally identifies any users.</li>\r\n\r\n            <li class=\"wow fadeIn\">2.4. Some of the advertisements you see on the Platform are selected and delivered by third parties, such as ad networks, advertising agencies, advertisers, and audience segment providers. These third parties may collect information about you and your online activities, either on the Platform or on other websites, through cookies, web beacons, and other technologies in an effort to understand your interests and deliver to your advertisements that are tailored to your interests. Please remember that We do not have access to, or control over, the information these third parties may collect. The information practices of these third parties are not covered by this privacy policy.</li>\r\n\r\n        </ul>\r\n\r\n        <h4 class=\"wow fadeIn\">3.   Non-Disclosure of Personal Information</h4>\r\n\r\n        <ul>\r\n\r\n            <li class=\"wow fadeIn\">3.1. You agree that We may share your Personal Information within Our company. We will not share, sell or rent your Personal Information in any manner to any third parties outside Our company except when we have your permission; or if required to do so by law or any governing authority; or to protect our own legitimate interests.</li>\r\n\r\n        </ul>\r\n\r\n        <h4 class=\"wow fadeIn\">4.   Security</h4>\r\n\r\n        <ul>\r\n\r\n            <li class=\"wow fadeIn\">4.1. Keeping your Personal Information secure and preventing unauthorized access is of utmost priority to Us, and We take all steps reasonably necessary to protect your Personal Information against any unauthorized access, use, alteration, disclosure or destruction. Whilst We have put in place physical, electronic and managerial procedures to secure and safeguard your Personal Information, We will not be held responsible for any unauthorized access by third parties and We cannot guarantee that the Personal Information provided by you or that is transmitted via the Platform or by e-mail is totally secure and safe.</li>\r\n\r\n        </ul>\r\n\r\n        <h4 class=\"wow fadeIn\">5.   Use of Cookies</h4>\r\n\r\n        <ul>\r\n\r\n            <li class=\"wow fadeIn\">5.1. Like many websites, the Platform uses cookies, which are files that store information on your hard drive. Cookies allow the Platform to identify account holders, track new users, record session information, and generally to optimize your experience. Most browsers accept cookies automatically but if you choose you can disable the cookies from your browser. For online advertising campaigns, cookies are automatically deleted after one (1) month.</li>\r\n\r\n            <li class=\"wow fadeIn\">5.2. We recommend that you leave cookies “turned on” so that you can enjoy a better experience on the Platform. You may occasionally get cookies from companies advertising on Our behalf or on behalf of Our subsidiaries. We do not control these cookies, and these cookies are not subject to this Privacy Policy.</li>\r\n\r\n        </ul>\r\n\r\n        <h4 class=\"wow fadeIn\">6.   Use of Google Analytics and Google Tracking Pixels</h4>\r\n\r\n        <ul>\r\n\r\n            <li class=\"wow fadeIn\">6.1. This Website uses Google Analytics, a web analytics service of Google Inc. (“Google”). Google Analytics uses cookies and/or text files to analyze website traffic. Information generated by cookies with your details (including your IP address) is transferred to a Google server in the United States of America. Google processes this information to evaluate your use of the Platform, compile reports about the Platform’s activity on Our behalf, and deliver other related services regarding website and Internet use. Google may also share this information with third parties insofar as this is necessary or if these third parties process the information on behalf of Google. Under no circumstances will Google use your IP address in connection with other data supplied by Google.</li>\r\n\r\n            <li class=\"wow fadeIn\">6.2. You may disable the cookies from your browser by adjusting your browser settings. However, in this scenario, you may not be able to make full use of all the functions available on the Platform. By using the Platform, you agree to Google’s processing of the type of information discussed in this section in the manner contemplated in this Policy. Us, and our respective suppliers, and any of our shareholders, subsidiaries, parent companies, and any of Our and their officers, directors, managers, members, agents, and employees, are not liable for any direct, indirect, punitive, incidental, special, or consequential damages or loss (including, without limitation, incidental and consequential damages, lost profits, or damages resulting from lost data or business interruption) arising out of, or in way connected with, the use of the type of information discussed in this section.</li>\r\n\r\n        </ul>\r\n\r\n        <h4 class=\"wow fadeIn\">7.   Tracking Pixels</h4>\r\n\r\n        <ul>\r\n\r\n            <li class=\"wow fadeIn\">7.1. Facebook and Google tracking pixels are used on the Platform. This means that third parties may use cookies, web beacons, and similar technologies to collect or receive information from the Platform and elsewhere on the internet and use that information to provide measurement services and targeted adverts. If you wish to opt out of the use of these tracking pixels please adjust your browser settings.</li>\r\n\r\n        </ul>\r\n\r\n    </div>\r\n\r\n</section>\r\n\r\n<section class=\"terms-section privacy-section\">\r\n\r\n    <h2 class=\"wow fadeIn\">Delivery Policy</h2>\r\n\r\n    <div class=\"termWrap privacyWrap\">\r\n\r\n        <ul>\r\n\r\n            <li>1.  Delivery Costs: The costs of delivery will be as displayed to you on our Site.</li>\r\n\r\n            <li>2.  Delivery Date: This information will be displayed to you on our Site.</li>\r\n\r\n            <li>3.  Delivery Delays:<ul>\r\n\r\n                <li>a.  If our supply of the product is delayed by an event outside of our control, then we will contact you as soon as possible to let you know and we will take steps to minimise the effect of the delay.</li>\r\n\r\n                <li>b.  If no one is available at your address to take delivery and the products cannot be posted through your letterbox, we will notify you of how to rearrange delivery or collect the product.</li>\r\n\r\n                <li>c.  If you do not collect the product from us as arranged or if, after a failed delivery to you, you do not re-arrange delivery or collect them from a delivery depot, we will contact you for further instructions. If, despite our reasonable efforts, we are unable to contact you or re-arrange delivery or collection, we will cancel your order.</li>\r\n\r\n            </ul></li>\r\n\r\n\r\n            <li>4.  ID Requirement Upon Delivery: We may, at our sole discretion, make any inquiry we deem necessary to verify your identity and/or ownership of your financial instruments by requesting that you provide us with further information or documentation, including, but not limited to requesting a form of identification and/or credit card. If we are unable to verify or authenticate any information you provide, we have the right to refuse delivery and cancel the order.</li>\r\n\r\n            <li>5.  Delivery from Overseas: Note that you might be considered the importer of record in the event that your order requires delivery from overseas. In such instance, you are required to ensure that your ordered products can be lawfully imported, comply with all laws and regulations and to pay all fees and customs duties relevant to your purchase.</li>\r\n\r\n            <li>6.  Title to Products: A product will be considered owned by you and your responsibility from the time we deliver the product to the delivery address and you have paid for the product.</li>\r\n\r\n            <li>7.  Invoice: We will issue an electronic invoice for your purchase and send such invoice to the email address you provided to us.</li>\r\n\r\n        </ul>\r\n\r\n    </div>\r\n\r\n</section>\r\n\r\n<section class=\"terms-section privacy-section\" id=\"agreement\">\r\n\r\n    <h2 class=\"wow fadeIn\">User Agreement</h2>\r\n\r\n    <div class=\"termWrap privacyWrap\">\r\n\r\n        <p>\r\n\r\n            The below preamble and general terms and conditions (“General Terms”), along with the privacy policy (“Privacy Policy”), and draw terms and conditions (“Draw Terms”) (together the “User Agreement”) constitute the contract between You and Lucramania Fitness Equipments (“Lucramania”, “We”, “Us”, “Our”) relating to the use of Our website (“Site”) and Our mobile app (“App”) (together the “Platform”) and Your participation in Our campaign draws (“Campaign Draws”).\r\n\r\n        </p>\r\n\r\n        <h4 class=\"wow fadeIn\">1.   Preamble</h4>\r\n\r\n        <ul>\r\n\r\n            <li class=\"wow fadeIn\">1.1. Any party using the Platform and/or participating in a Campaign Draw (“User”, “You”, “Your”), agrees to be bound by this User Agreement. If You do not agree to this User Agreement, or any of its terms (including any amendments), then You should immediately cease using the Platform and not enter any Campaign Draw.</li>\r\n\r\n            <li class=\"wow fadeIn\"> 1.2. This User Agreement is in effect as of 01 December 2020. We may amend this User Agreement at any point in time without notice and the amendments will take effect once they have been displayed on the Platform. You acknowledge and agree that it is Your responsibility to review this User Agreement periodically to familiarize Yourself with any modifications. Your continued use of the Platform or any of Our products, offerings and services, including, but not limited to, Campaign Draws (“Services”) following any amendments shall be construed as acceptance of those amendments.</li>\r\n\r\n        </ul>\r\n\r\n        <h3 class=\"wow fadeIn\">2. General Terms and Conditions</h3>\r\n\r\n        <h4 class=\"wow fadeIn\">2.1. Eligibility for Membership </h4>\r\n\r\n        <ul>\r\n\r\n            <li class=\"wow fadeIn\">2.1.1. It is imperative for Lucramania to ensure that its members are able to enter into legally binding contracts and that minors do not purchase, use, or have access to unsuitable content. Membership and/or use of the Platform is not availa