ng out of or in connection with this User Agreement, including any question regarding its existence, validity or termination, shall be subject to the exclusive jurisdiction of the Courts of the Dubai International Financial Centre. This Agreement shall be governed by and construed in accordance with the laws of the Dubai International Financial Centre.</li>\r\n\r\n        </ul>\r\n\r\n    </div>\r\n\r\n</section>\r\n</div>\r\n</section>',NULL,NULL,NULL,1,13),(44,'Contact Us','<div class=\"row\">\r\n   <div class=\"col-md-12 wow fadeIn\">\r\n      <p>Please fill in the form below and a dedicated member of our team will be in touch within 48 hours.</p>\r\n   </div>\r\n   <div class=\"col-md-8\">\r\n      <div class=\"contctForm wow fadeIn\">\r\n         <form enctype=\"multipart/form-data\" id=\"contact-us\" action=https://www.winztime.com/web/public/processContactUs\" class=\"contact-us-form-validate\"  method=\"post\">\r\n         <input type=\"hidden\" name=\"_token\">\r\n            <div class=\"row\">\r\n               <div class=\"col-md-6\">\r\n                  <div class=\"form-group\">\r\n                    <input type=\"text\" name=\"name\" placeholder=\"Name\" class=\"form-control contact-us-field-validate\" onkeypress=\"return /^[ A-Za-z-_@./#${}<>,?=;\'|\\!%*()&+-]*$/.test(event.key)\">                                 \r\n                  </div>\r\n               </div>\r\n               <div class=\"col-md-6\">\r\n                  <div class=\"form-group\">                                    \r\n                    <input type=\"email\" name=\"email\" placeholder=\"Email\" class=\"form-control contact-us-field-validate contact-us-email\">                              \r\n                  </div>\r\n               </div>\r\n               <div class=\"col-md-12\">\r\n                  <div class=\"form-group\">\r\n                     <select name=\"dropoptions\" class=\"form-control contact-us-field-validate\">\r\n                        <option valu