 frameborder=\"0\" style=\"border:0;\" allowfullscreen=\"\" aria-hidden=\"false\" tabindex=\"0\"></iframe>         \r\n</div>\r\n',NULL,NULL,NULL,1,15),(32,'How It Works','<div class=\"container\">\r\n      <div class=\"row\">\r\n        <div class=\"col-lg-7 col-md-7  col-sm-6\">\r\n <h1>Chance to win a prize in Dubai</h1>\r\n          <h2>How It Works</h2>\r\n          <p>Winning with us is as easy as A, B, C. Here is how our website works:</p>\r\n          <ol>\r\n            <li>First, create an account/login.</li>\r\n            <li>Search/browse through our product selection.</li>\r\n            <li>Check if the Product has a campaign or promotion going on. </li>\r\n            <li>Select the product/s you wish to buy and proceed to the checkout.</li>\r\n            <li>Once the payment is confirmed, you shall be notified about your order details and draw entries via email.</li>\r\n            <li>You will also receive your tax invoice via email.</li>\r\n            <li>Once a campaign ends and the draw is complete, the prize winner will be announced on our social media channels: Facebook &amp; Instagram.</li>\r\n            <li>Donate your product/s to charity and you will receive an extra complimentary ticket for the prize draw.</li>\r\n            <li>All draws are regulated under the Dubai economy department.</li>  \r\n          </ol>\r\n        </div>\r\n        <div class=\"col-lg-5 col-md-5  col-sm-6\">\r\n          <img src=\"https://winztime.com/images/media/2021/07/tVllU05905.png\" class=\"img-fluid\" alt=\"Win a luxury prize in dubai\">\r\n        </div>\r\n\r\n        <div class=\"about-video\">\r\n          <iframe width=\"100%\" height=\"645px\" src=\"https://www.youtube.com/embed/0oKHxrKP6po\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\"></iframe>\r\n        </div>\r\n      </div>\r\n    </div>','Gold rewards in UAE | Chance to Win a prize in Dubai','Chance to Win a prize in Dubai\r\n\r\nGold rewards in UAE','Winztime is a winning platform for you to get Gold rewards in UAE. Not only that, we give you an enormous chance to win a prize in Dubai. Stay tuned to Winztime.',1,10),(50,'Charities','<div class=\"container\">\r\n\r\n			<div class=\"row\">\r\n\r\n				<div class=\"col-lg-7 col-md-7 col-sm-6\">\r\n\r\n					<h1>Charities</h1>\r\n\r\n					<p>Our main objective at Winztime is to transform lives. We do not just want our customers to lead a better life but also children and less fortunate people. To achieve this we have partnered with Friends of Cancer Patients charity organization. Through this you can donate our products, or a percentage of the sales, to our charity partner.</p>\r\n\r\n					<p>To reward your generosity, Winztime will reward every donation by increasing the number of complimentary entries one receives for the prize draw. Through this we hope to achieve our dream: a win-win situation for everyone.</p>\r\n\r\n					<p>Friends of Cancer Patients is a non-profit organization, founded in 1999 under the directives and patronage of Her Highness Sheikha Jawaher bint Mohammed Al Qasimi, Wife of the Ruler of Sharjah, Founder and Patron of the Friends of Cancer Patients, International Ambassador of the World Cancer Declaration for Union for International Cancer Control (UICC), International Ambassador for Childhood Cancer for UICC and Patron of the Global NCD Alliance Forum.</p><p>FoCP is committed to help cancer patients and their families get through their long and arduous journey of cancer treatment. Since its inception, FoCP has delivered moral and financial support to cancer patients and their families, irrespective of their nationality, gender, age, religion or ethnicity.</p>\r\n\r\n				</div>\r\n\r\n				<div class=\"col-lg-5 col-md-5 col-sm-6\">\r\n\r\n					<img src=\"https://winztime.com/images/charityImg5.webp\" class=\"img-fluid\" alt=\"*\">\r\n\r\n				</div>\r\n\r\n			</div>\r\n\r\n		</div>',NULL,NULL,NULL,1,17),(42,'COVID-19 Response','<div class=\\\"row\\\">\r\n<div class=\\\"col-md-6\\\">\r\n<p>Dear Community,<br><br>\r\n\r\nOn behalf of all of us at Lucramania, please allow us to honor those on the front lines during these unprecedented times. Today we honor our heroes, starting with nurses, doctors, and healthcare providers around the world who are fighting the spread of COVID-19.<br> <br>\r\n\r\nAt home, Lucramania remains enduringly committed to the well-being of our community. We ensure highest sanitization of all of our products and packages before we ship them to our eager customers.<br>  <br>  \r\n\r\nStay safe, wash your hands, help others, keep exercising, eat healthy, and remain positive!<br><br>\r\n\r\nBest wishes,<br><br>\r\n\r\nLucramania’s Team</p>\r\n</div>\r\n<div class=\\\"col-md-6\\\">\r\n<figure><img src=\\\"images/covid.png\\\" /></figure>\r\n</div>\r\n</div>',NULL,NULL,NULL,1,14),(47,'Winners','<section class=\"pro-content main-section product-section \">\r\n  <h2 class=\"wow fadeIn animated\" style=\"visibility: visible;\">Winners</h2>\r\n  <div class=\"row\">\r\n    <div class=\"col-md-6 wow fadeIn\">\r\n      <a href=\"javascript:;\" class=\"productWrap swipe-to-top\" products_id=\"13\" data-toggle=\"tooltip\" data-placement=\"bottom\" data-original-title=\"\" title=\"\">\r\n        <h3>congratulations, John Doe!</strong></h3>\r\n        <h5>on winning Cash AED 40,000</h5>\r\n        <figure>\r\n          <img src=\"http://134.119.189.170:90/lucramania/public/images/media/2020/10/dpYLj04806.jpg\" alt=\"Europa Water Bottle\">\r\n          <img class=\"winnerIconWrp\" src=\"http://134.119.189.170:90/lucramania/public/images/media/2020/10/winnerIcon.png\" alt=\"*\">\r\n        </figure>\r\n        <figcaption>\r\n          <h4>Coupon no. CC-00001-00001-D</h4>\r\n          <p>Announced on January 09, 2021</p>\r\n        </figcaption>\r\n      </a>\r\n    </div>\r\n    <div class=\"col-md-6 wow fadeIn\">\r\n      <a href=\"javascript:;\" class=\"productWrap swipe-to-top\" products_id=\"12\" data-toggle=\"tooltip\" data-placement=\"bottom\" data-original-title=\"\" title=\"\">\r\n        <h3>congratulations, John Doe!</strong></h3>\r\n        <h5>on winning Cash AED 40,000</h5>\r\n        <figure>\r\n          <img src=\"http://134.119.189.170:90/lucramania/public/images/media/2020/10/HaUQb04306.jpg\" alt=\"Tachyon Jump Rope\">\r\n          <img class=\"winnerIconWrp\" src=\"http://134.119.189.170:90/lucramania/public/images/media/2020/10/winnerIcon.png\" alt=\"*\">\r\n        </figure>\r\n        <figcaption>\r\n          <h4>Coupon no. CC-00001-00001-D</h4>\r\n          <p>Announced on January 09, 2021</p>\r\n        </figcaption>\r\n      </a>\r\n    </div>\r\n  </div>\r\n</section>',NULL,NULL,NULL,1,16),(51,'Z points','<div class=\"container\">\r\n  <div class=\"row\">\r\n    <h1>Z points</h1>\r\n    <h4>What are Z points?</h4>\r\n    <p>Our loyal members receive 1 Z point on every 10 AED spent. These points can be collected and then used to make purchases.</p>\r\n    <h4>Can I transfer my Z points?</h4>\r\n    <p>Currently Z points cannot be transferred.</p>\r\n    <h4>Can a member purchase Z points?</h4>\r\n    <p>Our members cannot purchase Z points at the moment.</p>\r\n    <h4>How can a member earn more Z points?</h4>\r\n    <p>One can earn more Z points earned on every purchase by improving their tier status.</p>\r\n    <h4>Can we combine Z points with cash to make purchases?</h4>\r\n    <p>Z points can be combined with cash to complete a purchase. This option is only available when members have insufficient points to make a purchase.</p>\r\n    <h4>What is the minimum amount of points a member can withdraw/use?</h4>\r\n    <p>If a member has 125 points then they can use only 100 points otherwise they can wait and use 200 points in one go.</p>\r\n  </div>\r\n</div>',NULL,NULL,NULL,1,18),(52,'Charities','<section class=\\\"about-sec\\\" id=\\\"how-it-works-sec\\\">\n\n		<div class=\\\"container\\\">\n\n			<div class=\\\"row\\\">\n\n				<div class=\\\"col-lg-7 col-md-7 col-sm-6\\\">\n\n					<h1>Charities</h1>\n\n					<p>Our main objective at Winztime is to transform lives. We do not just want our customers to lead a better life but also children and less fortunate people. To achieve this we have partnered with Friends of Cancer Patients charity organization. Through this you can donate our products, or a percentage of the sales, to our charity partner.</p>\n\n					<p>To reward your generosity, Winztime will reward every donation by increasing the number of complimentary entries one receives for the prize draw. Through this we hope to achieve our dream: a win-win situation for everyone.</p>\n\n					<p>Friends of Cancer Patients is a non-profit organization, founded in 1999 under the directives and patronage of Her Highness Sheikha Jawaher bint Mohammed Al Qasimi, Wife of the Ruler of Sharjah, Founder and Patron of the Friends of Cancer Patients, International Ambassador of the World Cancer Declaration for Union for International Cancer Control (UICC), International Ambassador for Childhood Cancer for UICC and Patron of the Global NCD Alliance Forum.</p>\n\n					<p>FoCP is committed to help cancer patients and their families get through their long and arduous journey of cancer treatment. Since its inception, FoCP has delivered moral and financial support to cancer patients and their families, irrespective of their nationality, gender, age, religion or ethnicity.</p>\n\n				</div>\n\n				<div class=\\\"col-lg-5 col-md-5 col-sm-6\\\">\n\n					<img src=\\\"assets/images/charityImg5.webp\\\" class=\\\"img-fluid\\\" alt=\\\"*\\\">\n\n				</div>\n\n			</div>\n\n		</div>\n\n	</section>',NULL,NULL,NULL,1,19);
