INSERT INTO `products_description` VALUES (96,44,1,'Gym Towel','<p><span style=\"color: rgb(14, 16, 26); font-family: Arial, &quot;Arial Unicode MS&quot;, Arimo, &quot;Microsoft Sans serif&quot;, sans-serif; font-size: 14.6667px; white-space: pre-wrap;\">Ultra absorbent, soft and antibacterial, our microfiber Gym Towel is a convenience product. It soaks up three times more water than cotton. You can use it at the gym or even while doing yoga.</span><br></p>',NULL,0,NULL,0,0,NULL,0,0),(7,7,1,'Wrist Band','<p data-pm-slice=\"1 1 []\"><b>Never Give Up Wristband:</b></p><p data-pm-slice=\"1 1 []\">Some days we also don\'t want to workout. Our stylish and eye-catching \"Never Give Up\" Motivational Wristband can help you stay motivated. It is entirely waterproof and comfortable to wear. Thus, you can use it 24/7.</p>',NULL,0,NULL,0,0,NULL,0,0),(94,42,1,'Skipping Rope','<p>Love doing cardio? Then you will love our skipping rope too. Made of foam, it absorbs sweat and prevents slipping. Its length can get adjusted freely for convenient use.<br></p>',NULL,0,NULL,0,0,NULL,0,0),(95,43,1,'Purple Gym Towel','<p><span style=\"color: rgb(14, 16, 26); font-family: Arial, &quot;Arial Unicode MS&quot;, Arimo, &quot;Microsoft Sans serif&quot;, sans-serif; font-size: 14.6667px; white-space: pre-wrap;\">Ultra absorbent, soft and antibacterial, our microfiber Gym Towel is a convenience product. It soaks up three times more water than cotton. You can use it at the gym or even while doing yoga.</span><br></p>',NULL,0,NULL,0,0,NULL,0,0),(9,9,1,'Anti Stress Ball','<p data-pm-slice=\"1 1 []\">Tired after a long day? Use a Winztime Stress Relieving Ball to relax the muscles of your hands. They\'re soft, squeezable, and easy to catch, thus being an excellent way to relieve stress.<br></p>',NULL,0,NULL,0,0,NULL,0,0),(97,45,1,'Gym Bottle','<p data-pm-slice=\"1 1 []\">Carry your protein shake, water, or other sports supplements on your way to the gym with our cool Gym Bottle. With its large capacity of 2.2 liters, you can effortlessly meet your water needs during sports. It is the perfect companion to your daily gym visits. Made of sturdy and high-quality materials, it offers impact resistance, low-temperature resistance, environmental protection, and leakage-proof. Plus, it is safe to use and easy to clean.<br></p>',NULL,0,NULL,0,0,NULL,0,0),(12,12,1,'Gym Bag','<p data-pm-slice=\"1 1 []\">A multi-functional drawstring backpack, our Gym Bag makes a perfect sports bag, travel bag, and so on. It is lightweight so that one can easily carry it anywhere you want to. Made of waterproof fabric, it\'s perfect for people who enjoy trekking or swimming. Plus, it is unisex. So convenient that you can\'t miss it!<br></p>',NULL,0,NULL,0,0,NULL,0,0),(13,13,1,'Gym Bottle','<p data-pm-slice=\"1 1 []\">Carry your protein shake, water, or other sports supplements on your way to the gym with our cool Gym Bottle. With its large capacity of 2.2 liters, you can effortlessly meet your water needs during sports. It is the perfect companion to your daily gym visits. Made of sturdy and high-quality materials, it offers impact resistance, low-temperature resistance, environmental protection, and leakage-proof. Plus, it is safe to use and easy to clean.<br></p>',NULL,0,NULL,0,0,NULL,0,0),(98,46,1,'TEST TYEST','<p>asdasd</p>',NULL,0,NULL,0,0,NULL,0,0),(99,47,1,'Winztime Pencil','<p>Do you always write to remember things? The Winztime Pencil is here to help you. It\'s clean-grip and relaxed for writing. Use for writing and sketching and made of satisfactory high-quality wood and graphite lead.<br></p>',NULL,0,NULL,0,0,NULL,0,0);
