INSERT INTO `rewards` VALUES (1,'Samsung Mobile S21','85.png','<p>Designed with a unique contour-cut camera to create a revolution in photography. 100% Color Volume. Eye Comfort Shield. Super Smooth 60fps Video. 8K Video. These qualities make the Samsung Mobile S21 a powerhouse of a phone. </p>',120,'2021-06-29','2021-06-28 14:15:33','2021-06-30 08:15:19'),(2,'TAG HEUER AQUARACER Watch','12.png','<p>A sportwatch that is waterproof and doesn\'t even look like one? Yes it exists with the latest TAG HEUER Aquaracer Watch. Engineered to withstand heavy duty and water activities, this watch is the first amongst its kind to exist. </p>',75,'2021-06-29','2021-06-28 14:14:07','2021-06-30 08:15:14'),(3,'Gucci Bag (Gucci GG)','53.png','<p>Every woman dreams of owning a Gucci bag made from 100% pure Italian leather. Be it in black or in white, it makes the perfect handbag to take to a party or even at work. </p>',70,'2021-06-29','2021-06-28 13:43:29','2021-06-30 12:00:51'),(4,'Skydiving Voucher','23.png','<p>SkyDiving, also known as parachuting, is one of the most thrilling sports to exist. Every thrill seekers wish is to experience this thrilling sport at least once in their life. The adrenaline rush is surely not to be missed. </p>',30,'2021-06-29','2021-06-28 13:24:11','2021-06-30 08:14:28'),(5,'AED 10,000 worth of Gold','60.png','<p>Probably the most sought after currency in the world is gold. It is a welcomed addition to an investors portfolio. Not only investors but every person understands the need to have it as a form of investment or securing your money. Estimated worth: AED 10,000. \r\n</p>',5,'2021-03-11','2021-03-28 03:54:59','2021-06-30 08:13:59'),(6,'AED 3,000 worth of Gold','32.png','<p>Probably the most sought after currency in the world is gold. It is a welcomed addition to an investors portfolio. Not only investors but every person understands the need to have it as a form of investment or securing your money. Estimated worth: AED 15,000.</p>',5,'2021-03-18','2021-03-18 02:40:16','2021-09-15 16:08:57'),(7,'iPhone 12  (128GB)','63.png','<p>5G speed. A14 Bionic, the fastest chip in a smartphone. An edge-to-edge OLED display. Ceramic Shield with four times better drop performance. And Night mode on every camera. iPhone 12 has it all</p>',10,'2021-09-02','2021-09-02 12:28:41','2021-09-02 10:31:29'),(8,'AED 3,000 worth of Gold','39.png','<p>Probably the most sought after currency in the world is gold. It is a welcomed addition to an investors portfolio. Not only investors but every person understands the need to have it as a form of investment or securing your money. Estimated worth: AED 3,000.  </p>',10,'2021-09-02','2021-09-02 12:45:02','2021-09-15 16:33:26'),(9,'AED 1,000 Mall voucher','57.png','<p>An extraordinary gift voucher to commend life\'s most prominent minutes. Get a Mall voucher worth AED 1000. Redeemable at driving shopping centers in UAE.</p>',10,'2021-09-02','2021-09-02 13:15:39','2021-09-02 11:38:10'),(10,'PRIZE 1:AED 3,000 worth of Gold PRIZE 2: AED 1,000 Mall voucher (Two winners)','58.png','<p>Probably the most sought after currency in the world is gold. It is a welcomed addition to an investors portfolio. Not only investors but every person understands the need to have it as a form of investment or securing your money. Estimated worth: AED 3,000.  </p>',10,'2021-09-02','2021-09-02 13:16:33','2021-09-08 14:25:13'),(11,'AED 5,000 worth of Gold','100.png','<p>Probably the most sought after currency in the world is gold. It is a welcomed addition to an investors portfolio. Not only investors but every person understands the need to have it as a form of investment or securing your money. Estimated worth: AED 5,000.  </p>',10,'2021-09-02','2021-09-02 13:20:06','2021-09-12 17:31:40'),(12,'PRIZE 1: AED 10,000 PRIZE 2:  AED 5,000 worth of gold (Two Winners)','62.png','<p>Probably the most sought after currency in the world is gold. It is a welcomed addition to an investors portfolio. Not only investors but every person understands the need to have it as a form of investment or securing your money. Estimated worth: AED 15,000.  </p>',10,'2021-09-02','2021-09-02 13:20:51','2021-09-13 13:41:11'),(13,'iPhone 13 Pro (128GB)','87.jpg','<p class=\"MsoNormal\" style=\"margin-bottom:7.5pt\"><span style=\"mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;\r\ncolor:#0D0D0D;mso-themecolor:text1;mso-themetint:242;mso-ansi-language:EN-GB;\r\nmso-fareast-language:EN-GB\">The latest iPhone 13 Pro&nbsp;128GB Sierra Blue 5G&nbsp;has a\r\ndramatically more powerful camera system. A display so responsive, every\r\ninteraction feels new again. The world’s fastest smartphone chip. Exceptional\r\ndurability. And a huge leap in battery life. Ceramic Shield, tougher than any\r\nsmartphone glass. iPhone 13 Pro are splash, water, and dust resistant. Sharper,\r\nmore detailed photos and videos in any light. With its redesigned lens and\r\npowerful autofocus system, the new Ultra Wide camera can focus at just 2 cm —\r\nmaking even the smallest details seem epic. Transform a leaf into abstract art.\r\nCapture a caterpillar’s fuzz. Magnify a dewdrop. The beauty of tiny awaits.<o:p></o:p></span></p>',1,'2021-09-20','2021-09-20 09:20:55','2021-11-08 14:49:37'),(15,'Apple Watch S7','90.png','The first fitness service powered by Apple Watch. Apple Fitness+ is a different kind of fitness experience. There are new workouts every week, from 5 to 45 minutes. Eleven workout types, including HIIT, Strength, Pilates, and Yoga. Guided Meditations to help you focus on your overall wellbeing. And personal metrics from Apple Watch synced to your iPhone, iPad, and Apple TV.',1,'2021-11-08','2021-11-08 15:08:00','2021-11-08 15:20:06'),(16,'Samsung Galaxy Watch 4','66.png','This rotating bezel turns more than heads some looks are timeless, like the Galaxy Watch4 Classics rotating bezel and vivid screen. The refined design adds sophistication to your wrist for an elevated style. Its high-end stainless steel materials shows off its powerful and intuitive functionality.A new day. A new watch face choose between analog or digital watch faces with a variety of backgrounds, fonts, and colors to match your tastes, the weather, or occasion. Spice up your character watch faces with AR Emojis to express your style, while animated graphics show what you\'re up to, like running or listening to music.Healthy starts here name a workout, it can track it. Track your activities and fitness scores on your watch and phone. Count steps, check calories, and stay on the grid with GPS. Galaxy Watch 4 Classic detects physical activity to track your routines and supports more than 90 exercises for a more accurate report of your workouts.',1,'2021-11-08','2021-11-08 15:26:32','2021-11-08 16:39:18'),(17,'Prize 1: SAMSUNG TV 55\"<br> Prize 2: Apple watch S7<br> Prize 3: Samsung watch 4 (Three Winners)','37.png','',1,'2021-11-08','2021-11-08 15:33:34','2021-11-09 11:52:46'),(18,'Samsung TV 55\"','34.png','55-Inch Crystal UHD 4K Flat Smart TV (2021) UE55AU71000 BLACK',1,'2021-11-08','2021-11-08 15:54:24','2021-11-09 10:59:23');
